pragma solidity ^0.8.26;

library Math {
     function sqrt(uint y) internal pure returns (uint z) {
        if (y > 3) {
            z = y;
            uint x = y / 2 + 1;

            while (x < z) {
                z = x ;
                x = (y / x + x)/ 2 ;
            }
        } else if (y != 0)
        {
            z = 1;
        }
        // else z = 0 (defualt value)
     }
}

contract testMath 
{
    function testSquareRoot(uint x) public pure returns (uint) {
        return Math.sqrt(x);

    }
}
// array function to delete element a index  and re orgainize the array
// so that there are no gaps between the element s
library Array {
    function remove(uint[] storage arr, uint index) public
    {
        // Move the last element into the place to delete
        require(arr.length > 0, "can rmove from empty array");
        arr[index] = arr[arr.length -1];
        arr.pop();

    }
}

  contract TestArray{
    using Array for uint[];

    uint[] public arr;

    function testArrayRemove() public{
        for (uint i= 0; i< 3; i++){
          arr.push(i)  ;
        }
        arr.remove(1);

        assert(arr.length == 2);
        assert(arr[0] == 0);
        assert(arr[1] == 2);
    }
   
  }

